export function generateImpressions(count) {
  var impressions = [];

  for (var i = 0; i < count; i++) {
    impressions.push({
      keyName: "key_".concat(i),
      feature: "feature_".concat(i % 10),
      label: i % 2 === 0 ? 'in segment all' : 'whitelisted',
      changeNumber: i * i,
      time: Date.now()
    });
  }

  return impressions;
}